554	0	0	0	Linux에서 커널 파라미터를 영구적으로 변경하는 방법을 설명해주세요.	커널 파라미터는 `sysctl -w` 명령어로 일시적으로 변경할 수 있으며, 영구적으로 적용하려면 `/etc/sysctl.conf` 또는 `/etc/sysctl.d/*.conf` 파일에 설정을 추가해야 합니다. 이후 `sysctl --system`을 실행하여 변경 사항을 적용할 수 있습니다.
